import React from "react";
//Styles
import "./Icons.css";
type props = {
	title: string;
};

const Icons: React.FC<props> = ({ title }) => {
	const icon_container = React.useRef<HTMLDivElement>(null);

	const onClick = (e: MouseEvent) => {
		e.preventDefault();
	};
	const onFocus = (e: FocusEvent) => {
		e.preventDefault();
		if (icon_container.current)
			icon_container.current.style.background = "blue";
	};
	return (
		<div
			className='icon-container'
			ref={icon_container}
			onFocus={() => onFocus}
			onClick={() => onClick}>
			<span>{title}</span>
		</div>
	);
};

export default Icons;
